import Button from "./Button"



const MathOperations = () => {
    return (
        <div className="math-operations">
            <Button text="+" />
            <button>-</button>
            <button>*</button>
            <button>/</button>
            <button>=</button>
        </div>
    )
}

export default MathOperations
